// PrivateHeader.js
import React from 'react';
import { Link } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import logo from '../assets/images/logo.png';
import { useAuth } from '../AuthContext';

const PrivateHeader = () => {
  const { logout } = useAuth();

  const handleLogout = () => {
    // Logout logic
    logout();
  };

  return (
    <header style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', backgroundColor: '#7A9C59', color: '#fff', padding: '20px 0' }}>
      <a href='/' style={{ marginLeft: '50px' }}>
        <img src={logo} height='35px' alt="Logo" />
      </a>
      <div style={{ marginRight: '50px' }}>
        <Container>
          <nav>
            <ul style={{ listStyle: 'none', padding: 0, margin: 0 }}>
              <li style={{ display: 'inline', marginRight: '20px' }}>
                <Link to="/" style={{ textDecoration: 'none', color: '#fff' }}>
                  HOMEPAGE
                </Link>
              </li>
              <li style={{ display: 'inline', marginRight: '20px' }}>
                <Link to="/about-us" style={{ textDecoration: 'none', color: '#fff' }}>
                  ABOUT US
                </Link>
              </li>
              <li style={{ display: 'inline', marginRight: '20px' }}>
                <Link to="/contact-us" style={{ textDecoration: 'none', color: '#fff' }}>
                  CONTACT US
                </Link>
              </li>
              <li style={{ display: 'inline' }}>
                <button onClick={handleLogout} style={{ textDecoration: 'none', color: '#fff', background: 'none', border: 'none', cursor: 'pointer' }}>
                  LOGOUT
                </button>
              </li>
            </ul>
          </nav>
        </Container>
      </div>
    </header>
  );
};

export default PrivateHeader;
